import React from 'react'

export default function GraphButtons() {
    return (
        <div>
            <h1>See Your Results!</h1>
            <p>
                Check out the updated graph and see how well you did
            </p>
            <p>
                The results dashboard tells you how accurately your model
                performed and shows you the degree and cost parameters you
                or the optimize feature chose.
            </p>
        
        </div>
    );
}
